import axios from 'axios';

const API_URL = process.env.VUE_APP_API_URL || 'http://localhost:5000';

export default {
  /**
   * 获取仪表盘概览数据
   */
  getDashboardOverview() {
    return axios.get(`${API_URL}/api/system/dashboard`);
  },
  
  /**
   * 获取系统告警数据
   */
  getSystemAlerts() {
    return axios.get(`${API_URL}/api/system/alerts`);
  }
};
